using System;
using System.Collections.Generic;
using System.Text;

class Episode1
{
	static void Main()
	{
		int N = int.Parse(Console.ReadLine());

		// Read the requested wine lists and encode them into a neutral alphabet
		List<string> requests = new List<string>();
		for (int i = 0; i < N; i++) requests.Add(EncodeWine(Console.ReadLine()));

		// Repeat for the crates
		List<string> crates = new List<string>();
		for (int i = 0; i < N; i++) crates.Add(EncodeWine(Console.ReadLine()));

		// Now loop through the requests and look for the matching one in the crates list
		for (int i = 0; i < N; i++)
			Console.WriteLine(crates.IndexOf(requests[i]) + 1);
	}
	static string EncodeWine(string wine)
	{
		// The idea is to build a dictionary of A-Za-z to a neutral encoded alphabet as we read from left to right.
		// In this way, a request AZZAA becomes 12211, and its matching crate SFFSS also becomes 12211,
		// where '1' is the first wine type encountered, '2' is the second...
        // Instead of using a list of ints as the neutral code, I just use ASCII 0-25

		var dict = new Dictionary<char, char>();
		StringBuilder sb = new StringBuilder();
		char letter = (char) 0;
		foreach (char c in wine) {
			if (!dict.ContainsKey(c))
				dict.Add(c, letter++);
			sb.Append(dict[c]);
		}
		return sb.ToString();
	}
}
